import React from "react";
import { Container, Row, Col } from "../../components/Grid";
import { Card, CardBody, Cartitle } from "../../components/Card";
import AddGroup from "./AddGroup";

const ServiceMenu = () => (
    <Container>
        <Row>
            <Col size="md-6">
                <Card>
                    <form>
                        <Input 
                            value={this.state.group}
                        />

                    </form>

                </Card>
            </Col>
            <Col size="md-6">
                <Card>
                    
                </Card>
            </Col>
        </Row>

    </Container >

);

export default ServiceMenu;
